import React from 'react'

function ExtractCsvTable(items) {
    console.log(items.tableData)
    let data = items.tableData ? items.tableData: [];
    let column = [];
    if(data.length > 0){
        column = Object.keys(data[0])
    }

    return (
        <>
          <table>
              <thead>
                  <tr>
                {column.map((item,index)=>{
                    return(
                        <th id={index}>{item}</th>
                    )
                })}
                </tr>
              </thead>
              <tbody>
         {data.map((item,index)=>{
              return ( 
                <tr id={index}>
                <td id={index+"-username"}>{item.username}</td>
                <td id={index+"-fname"}>{item.first_name}</td>
                <td id={index+"-lname"}>{item.last_name}</td>
                <td id={index+"-email"}>{item.email}</td>
                <td id={index+"-phone"}>{item.phone}</td>
                </tr>
              )
            })}
            </tbody>
            </table>
        </>
    )
}

export default ExtractCsvTable
